import genID from "../utils/genID";
import {reset} from 'redux-form';

const SEND_MESSAGE = 'dialogs/SEND-MESSAGE';

let initialState = {
    dialogs: [
        {
            id: 1,
            name: 'John',
            avatarURL: 'data:image/jpeg;base64,'
        },
        {
            id: 2,
            name: 'Mary',
            avatarURL: 'data:image/jpeg;base64,'
        },
        {
            id: 3,
            name: 'Sam',
            avatarURL: 'data:image/jpeg;base64,'
        },
    ],
    messenger: {
        messages: [
            {message: 'Hi!', fromId: 0, id: 0},
            {message: 'Hi, bro!', fromId: 1, id: 1},
            {message: 'How are you?', fromId: 0, id: 2},
        ],
    }
};

const dialogsReducer = (state = initialState, action) => {
    switch (action.type) {
        case SEND_MESSAGE: {
            let newMessage = {
                message: action.msg,
                fromId: 0,
                id: genID(),
            };

            return {
                ...state,
                messenger: {
                    messages: [...state.messenger.messages, newMessage],
                },
            };
        }
        default:
            return state;
    }
};


export default dialogsReducer;
export const resetForm = (formName) => (dispatch) => {
    dispatch(reset(formName));
};

export const sendMessage = (msg) => ({type: SEND_MESSAGE, msg});